import NavItem from "./navitem";

const NavBar = (props) => {
	return (
		<nav className="navbar">
			<div className="nav-bar-webtitle">
				<h1 id="nav-webtitle">Self OKRs</h1>
			</div>
			<div>
				<ul className="navbar-nav">
					<NavItem title={"Goals"} />
					<NavItem title={props.username} />
				</ul>
			</div>
		</nav>
	);
}

export default NavBar;
